import React from 'react';
export const Cell = ({ cell: { value = '', isGrouped }, row, webComponentsReactProperties }) => {
    let cellContent = `${value !== null && value !== void 0 ? value : ''}`;
    if (isGrouped) {
        cellContent += ` (${row.subRows.length})`;
    }
    return (React.createElement("span", { title: cellContent, className: webComponentsReactProperties.classes.tableText }, cellContent));
};
